#### Interpretation

**1**   (1) In this Act:

**"appellant"** means a person who was a party to the proceedings in the court appealed from and is

(a) bringing an appeal, or

(b) applying for leave to appeal;

**"chief justice"** means the Chief Justice of British Columbia;

**"court"** means the Court of Appeal for British Columbia;

**"court appealed from"** means the court, or tribunal, from which an appeal is brought;

**"justice"** means a Justice of Appeal of the court;

**"leave to appeal"** means permission from the court or a justice to appeal an order;

**"limited appeal order"** means an order, prescribed in the rules as a limited appeal order, that requires leave to appeal;

**"order"** includes

(a) a judgment,

(b) a decree, and

(c) an opinion, advice, direction, determination, decision or declaration that is specifically authorized or required under an enactment to be given or made;

**"party"**, in relation to an appeal, means

(a) the appellant, or

(b) a respondent who, in accordance with the rules, is a participant in the appeal;

**"registrar"** means a person appointed under section 10 (1) as

(a) the registrar,

(b) the associate registrar, or

(c) a deputy registrar;

**"respondent"** means either of the following:

(a) a person, other than the appellant,

(i)  who was a party to the proceedings in the court appealed from, and

(ii)  whose interests are affected by the relief requested by the appellant in an appeal;

(b) a person who is added, under the rules, as a respondent to an appeal;

**"rules"** means rules made under the [*Court Rules Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96080_01) governing practice or procedure of the court;

**"tribunal"** includes a commission, board or panel.

(2) Section 5 of the [*Offence Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96338_01) does not apply to this Act.

#### Administrators of court services

**11**   (1) The following persons may be appointed under the [*Public Service Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96385_01):

(a) a chief administrator of court services for the court;

(b) a deputy chief administrator of court services for the court;

(c) an administrator of court services for each registry of the court;

(d) other persons necessary to carry out the purposes of this Act and the rules.

(2) The chief administrator of court services must direct and supervise facilities, registries and administrative services for the court, subject to the direction of

(a) the chief justice for matters of judicial administration, and

(b) the Attorney General for other matters.

#### No appeal to be defeated by irregularities

**19**   (1) An appeal is not defeated by an irregularity or procedural error in the conduct of the appeal.

(2) If an irregularity or procedural error has occurred in the conduct of an appeal, a justice may do one or more of the following:

(a) validate an act, matter or thing rendered or alleged to have been rendered invalid by or as a result of the irregularity or procedural error;

(b) impose terms and conditions, including the granting of an adjournment or the payment of costs;

(c) make any other order the justice considers appropriate to address the irregularity or procedural error.

#### Limiting hearings and requiring preparation of written arguments

**26**   (1) Before or during the hearing of a matter that is to be decided by the court, the court may do one or more of the following, either generally or in relation to a particular issue:

(a) order that the hearing be conducted

(i)  in writing, or

(ii)  by telephone, video conference or other means of telecommunication;

(b) order that the matter be decided without a hearing;

(c) limit the time for the hearing;

(d) limit the time for the hearing of an argument by any person.

(2) Before, during or after the hearing of a matter that is to be decided by the court, the court may order a party to prepare written arguments on any issue, whether or not the issue has been previously addressed by the party.

#### General powers of a justice

**30**   In an appeal or other matter before the court, a justice may do one or more of the following:

(a) make orders incidental to the appeal or matter not involving a decision of the appeal on the merits;

(b) make orders or give directions for the purposes of managing the conduct of the appeal or other matter;

(c) make interim orders to prevent prejudice to any person;

(d) exercise the powers referred to in the following sections for the purposes of a matter that is to be decided by a justice:

(i)  section 24 (2) (a) and (b) *[general powers of court]*;

(ii)  section 26 *[limiting hearings and requiring preparation of written arguments]*;

(e) exercise the powers given to the registrar by this Act or the rules;

(f) grant leave to intervene;

(g) refer any application to the court;

(h) make any order with the consent of all parties to the appeal;

(i) in making any order, impose terms and conditions and give directions that the justice considers just.

#### Stays of proceedings

**33**   (1) After an appeal or application for leave to appeal is brought, a justice may, on terms and conditions the justice considers appropriate, order a stay of all or part of proceedings, including execution, in the cause or matter from which the appeal is brought.

(2) After an appeal has been decided, a justice may, on terms and conditions the justice considers appropriate, do one or both of the following:

(a) make an order under subsection (1);

(b) make any other order to preserve the rights of the parties pending further proceedings.

(3) Without limiting subsection (1) or (2), a justice may order one or more of the following:

(a) that documents be delivered;

(b) that possession of land or personal property be given;

(c) that property be placed in the custody of a person specified by the justice;

(d) that an instrument be executed;

(e) that perishable property be sold and the proceeds paid into the court or the court appealed from;

(f) that a direction be given to a sheriff or poundage be disallowed;

(g) that a person be paid money received by a sheriff under an execution;

(h) that security be given for any purpose in a form and manner directed by the justice.

#### Failure to comply

**36**   A justice may do one or more of the following if a party fails to comply with this Act or the rules or an order or direction of the court, a justice or the registrar:

(a) refuse to hear the party;

(b) impose terms and conditions, including the payment or disallowance of costs;

(c) if the party is an appellant, dismiss the appeal as abandoned.

#### Transition — definitions

**47**   In this section and sections 48 to 51:

**"effective date"** means the date on which this section comes into force;

**"former Act"** means the [*Court of Appeal Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96077_01), R.S.B.C. 1996, c. 77;

**"former rules"** means the Court of Appeal Rules, B.C. Reg. 297/2001.
